import React, { useEffect, useState } from 'react';
import logo from '../../../Resorces/logo_RLAB.png';
import './nav.css';
import {Link} from 'react-router-dom'
const Navbar = () => {
    const [show, handleShow] = useState(false)
    useEffect(() => {
        window.addEventListener('scroll', () => {
            if (window.scrollY > 100) {
                handleShow(true);
            } else {
                handleShow(false);
            }
        });
        return() => {
            window.removeEventListener("scroll");
        }
    }, []);
    return (
        <div >
            <nav class={`navbar navbar-expand-lg navbar-dark  navAvatar ${show && "navBlack"}`}>
                <div class="container-fluid">
                    <a class="navbar-brand" href="#"><img style={{width:'10%'}} src={logo} alt=""/></a>
                    <button
                        class="navbar-toggler"
                        type="button"
                        data-bs-toggle="collapse"
                        data-bs-target="#navbarNav"
                        aria-controls="navbarNav"
                        aria-expanded="false"
                        aria-label="Toggle navigation">
                        <span class="navbar-toggler-icon"></span>
                    </button>
                    <div class="collapse navbar-collapse" id="navbarNav">
                        <ul class="navbar-nav ms-auto">
                            <li class="nav-item">
                                <a class="nav-link active" aria-current="page" href="#">Home</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link" href="#">Products</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link" href="#">About us</a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link" href="#">contract us</a>
                            </li>
                            <li class="nav-item">
                                <Link class="nav-link" to="/dashboard">Da</Link>
                            </li>
                            
                        </ul>
                    </div>
                </div>
            </nav>
        </div>
    );
};

export default Navbar;
